import './App.css';
import Navbar from './Navbar'
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.min.js';
import './css/main.css';
import SlideShow from './SlideShow'
import SearchAndBackground from './SearchAndBackground'
import Eval from './img/eval.jpeg'


function App() {
  return (
    <div className="App">
      <Navbar/>
      <SearchAndBackground/>
      <SlideShow/>
      <div className="menu" style={{position: 'relative', top: '100px', left: '30%'}}>
        <img style={{zoom: '0.7'}}src={Eval} alt="Eval"/>
      </div>
      <ActionMenu/>
    </div>
  );
}

export default App;
